es’ follow up to the DC Super Hero’s first outing, 2017’s record-breaking “Wonder Woman,” which took in $822 million at the worldwide box office. The film also stars Chris Pine as Steve Trevor, Kristen Wiig as The Cheetah, Pedro Pascal as Max Lord, Robin Wright as Antiope, and Connie Nielsen as Hippolyta.\n\nCharles Roven, Deborah Snyder, Zack Snyder, Patty Jenkins, Gal Gadot and Stephen Jones are producing the film. Rebecca Steel Roven Oakley, Richard Suckle, Marianne Jenkins, Geoff Johns, Walter Hamada, Chantal Nong Vo and Wesley Coller are the executive producers.\n\nPatty Jenkins directed from a screenplay she wrote with Geoff Johns \u0026 David Callaham, story by Jenkins \u0026 Johns, based on characters from DC. Joining the director behind the scenes are several members of her “Wonder Woman” team, including director of photography Matthew Jensen, Oscar-nominated production designer Aline Bonetto (“Amélie”), and Oscar-winning costume designer Lindy Hemming (“Topsy-Turvy”). Oscar-nominated editor Richard Pearson (“United 93”) is cutting the film. The music is by Oscar-winning composer Hans Zimmer (“Dunkirk,” “The Lion King”).\n\nWarner Bros. Pictures Presents an Atlas Entertainment/Stone Quarry Production, a Patty Jenkins Film, “Wonder Woman 1984.” Set to release in theaters on December 25, 2020 in 2D and 3D in select theaters and IMAX, it will be distributed worldwide by Warner Bros. Pictures. The film will also premiere on HBO Max in the U.S. on December 25, 2020.\n\nThis film is rated PG-13 for sequences of action and violence.\n\nAbout Warner Bros. Entertainment:\nAt Warner Bros. Entertainment, we believe in the power of story. From classics to contemporary masterpieces, explore and watch a library full of extraordinary, stirring, and provocative entertainment that goes beyond the big screen. Subscribe to discover new favorites from the studio that brought you Friends, JOKER, the Conjuring Universe, and The Wizarding World of Harry Potter™.\n\nWonder Woman 1 e 1980s as Wonder Woman’s next big screen adventure finds her facing two all-new foes: Max Lord and The Cheetah.\n\nWith director Patty Jenkins back at the helm and Gal Gadot returning in the title role, “Wonder Woman 1984” is Warner Bros. Pictures’ follow up to the DC Super Hero’s first outing, 2017’s record-breaking “Wonder Woman,” which took in $822 million at the worldwide box office. The film also stars Chris Pine as Steve Trevor, Kristen Wiig as The Cheetah, Pedro Pascal as Max Lord, Robin Wright as Antiope, and Connie Nielsen as Hippolyta.\n\nCharles Roven, Deborah Snyder, Zack Snyder, Patty Jenkins, Gal Gadot and Stephen Jones are producing the film. Rebecca Steel Roven Oakley, Richard Suckle, Marianne Jenkins, Geoff Johns, Walter Hamada, Chantal Nong Vo and Wesley Coller are the executive producers.\n\nPatty Jenkins directed from a screenplay she wrote with Geoff Johns \u0026 David Callaham, story by Jenkins \u0026 Johns, based on characters from DC. Joining the director behind the scenes are several members of her “Wonder Woman” team, including director of photography Matthew Jensen, Oscar-nominated production designer Aline Bonetto (“Amélie”), and Oscar-winning costume designer Lindy Hemming (“Topsy-Turvy”). Oscar-nominated editor Richard Pearson (“United 93”) is cutting the film. The music is by Oscar-winning composer Hans Zimmer (“Dunkirk,” “The Lion King”).\n\nWarner Bros. Pictures Presents an Atlas Entertainment/Stone Quarry Production, a Patty Jenkins Film, “Wonder Woman 1984.” Set to release in theaters on December 25, 2020 in 2D and 3D in select theaters and IMAX, it will be distributed worldwide by Warner Bros. Pictures. The film will also premiere on HBO Max in the U.S. on December 25, 2020.\n\nThis film is rated PG-13 for sequences of action and violence.\n\nAbout Warner Bros. Entertainment:\nAt Warner Bros. Entertainment, we believe in the power of story. From classics to contemporary masterpieces, explore and watch a library full of extraordinary, stirring, and provocative entertainment that goes beyond the big screen. Subscribe to discover new favorites from the studio that brought you Friends, JOKER, the Conjuring Universe, and The Wizarding World of Harry Potter™.\n\nWonder Woman 1984 | Retro Remix | Warner Bros. Entertainment\n   • Wonder Woman 1984 | Retro Remix | War...  \n\nWarner Bros. Entertainment \n   / warnerbrosonline  ","commandRuns":[{"startIndex":5,"length":16,"onTap":{"innertubeCommand":{"clickTrackingParams":"CCsQ3NcEGBMiEwjk95f8kvOLAxVkFskCHQyQNqk=","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/wonderwoman1984","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUTCg93b25kZXJ3b21hbjE5ODQYAQ%3D%3D"}}},"loggingDirectives":{"trackingParams":"CCsQ3NcEGBMiEwjk95f8kvOLAxVkFskCHQyQNqk="}},{"startIndex":95,"length":5,"onTap":{"innertubeCommand":{"clickTrackingParams":"CCoQ3NcEGBQiEwjk95f8kvOLAxVkFskCHQyQNqk=","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/ww84","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUICgR3dzg0GAE%3D"}}},"loggingDirectives":{"trackingParams":"CCoQ3NcEGBQiEwjk95f8kvOLAxVkFskCHQyQNqk="}},{"startIndex":143,"length":21,"onTap":{"innertubeCommand":{"clickTrackingParams":"CB4Q040EGAQiEwjk95f8kvOLAxVkFskCHQyQNqlIgca33KjrhuQQ","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqblZSZmxmOEJSVHEzWHlDTFNJaFZLM3c0dHNIUXxBQ3Jtc0trZnY3QTlBVjBaZmZ1RENUQzJXb3lJS3RqVmVSLUxBak9lSjdIY0JOWkxQdE5xRkV4TkxwQ0h3bG1QVWY1Y2tDZlVyVEdvS3FMU2E4T2k2VjdJQm5BcHZvZEhWNEMtdjA3cFc3NFEtX3pick9yNTQ1VQ\u0026q=http%3A%2F%2Fbit.ly%2F32v18jf\u0026v=EMgbWouN4wE","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqblZSZmxmOEJSVHEzWHlDTFNJ
